export const SAVE_SNIPPET = gql`
  mutation SaveSnippet($title: String!, $code: String!, $description: String!, $language: String!) {
    saveSnippet(title: $title, code: $code, description: $description, language: $language) {  // <- Fixed the missing comma
      _id
      username
      email
      snippetCount
      savedSnippets {
        title
        code
        description
        language
        createdAt
        _id
      }
    }
  }
`;
